package com.ceva.user.security;

import java.math.BigInteger;

public enum KeyConstants {
	
	PUBLOCALMODULUS(""),
	PUBLOCALEXPONENT("65537"),
	PVTLOCALMODULUS(""),
	PVTLOCALEXPONENT(""),
	PUBWEBMODULUS(""),
	PUBWEBEXPONENT("65537"),
	;
	
	String value;
	KeyConstants(String value)
	{
		this.value = value;
	}
	public BigInteger getValue() {
		return new BigInteger(value);
	}
	
	
}
